// Redux
import { Provider } from 'react-redux';
import { store } from './store';

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './app.css';
import CategoryRecipes from './components/main/CategoryRecipes';
import Recipe from './components/main/Recipe';
import LatestRecipe from './components/main/LatestRecipe';
import Dashboard from './components/dashboard/Dashboard';
import Homepage from './components/homepage/Homepage';






const App = () => {
  return (
    <Provider store={store}>
      <Router>
        <div>
          <Switch>
          <Route path='/' component={Homepage} />

              <Route exact path='/' component={LatestRecipe} />
              <Route exact path='/:category' component={CategoryRecipes} />
              <Route exact path='/:category/:slug' component={Recipe} />
              <Route exact path='/dashboard' component={Dashboard} />
            </Switch>
            </div> 
      </Router>
    </Provider>
  );
}

export default App;
